<script>
export default {
  name: "ConectingCars",
  mounted() {
    const svgs = document.querySelectorAll('.animated-svg');
    let currentIndex = 0;
    
    // Función para ocultar el SVG después de 4 segundos
    const hideSvg = (index) => {
      setTimeout(() => {
        svgs[index].style.visibility = 'hidden';
      }, 3500); // Después de 3.5 segundos, que es cuando termina la animación de crecimiento y visibilidad
    };

    // Función para mostrar el siguiente SVG
    const showNextSvg = () => {
      if (currentIndex < svgs.length) {
        // Asegurarse de que el SVG actual se haga visible primero
        svgs[currentIndex].style.visibility = 'visible';
        hideSvg(currentIndex);

        // Esperar 0.25 segundos para el siguiente SVG para que no se vea vacío
        setTimeout(() => {
          currentIndex++;
          if (currentIndex >= svgs.length) {
            currentIndex = 0;
          }
          // Mostrar el siguiente SVG
          svgs[currentIndex].style.visibility = 'visible';
        }, 3750); // Este es el tiempo que dura el SVG visible (3.5s + 0.25s para el siguiente)
      }
    };

    // Mostrar el primer SVG y luego comenzar el ciclo
    svgs[currentIndex].style.visibility = 'visible';
    hideSvg(currentIndex);
    currentIndex++;

    // Ciclo para manejar la animación entre los SVGs
    setInterval(showNextSvg, 4000); // Ciclo de 4 segundos por cada SVG
  }
};
</script>

